import React from "react";

users = [
  {
    id: 1,
    firstname: 'Bob',
    lastname: 'Marley',
    bio: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Distinctio, voluptas.',
    age: 40,
    isHappy: true
  },
  {
    id: 2,
    firstname: 'John',
    lastname: 'Doe',
    bio: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Distinctio, voluptas.',
    age: 22,
    isHappy: false
  }
];

export default users
